import Vue from "vue";
import Vuex from "vuex";
import axios from "axios";
import localInfo from "./models/infoItems";
import posts from "./models/posts";

Vue.use(Vuex);

export const store = new Vuex.Store({
  modules: {
    localInfo,
    posts,
  },
});
